import React from "react";
import "./pl.scss";
import { DiJavascript,DiJava } from "react-icons/di";
const iconSize=100;
const Pl = () => {
  return (
    <div className="programing-skills">
      <div>
        <DiJavascript size={iconSize} />
        <p>
          <b>JavaScript</b>
        </p>
      </div>
      <div>
          <DiJava/>
      </div>
    </div>
  );
};
export default Pl;
